api/createLocalVue.html.body:
createLocalVue()

Returns:

{Component}


Usage:


createLocalVue returns a Vue class for you to add components, mixins and install plugins without polluting the global Vue class.
Use it with options.localVue
import { createLocalVue, shallow } from 'vue-test-utils'
import { expect } from 'chai'
import Foo from './Foo.vue'

const localVue = createLocalVue()
const wrapper = shallow(Foo, {
  localVue,
  intercept: { foo: true }
})
expect(wrapper.vm.foo).to.equal(true)

const freshWrapper = shallow(Foo)
expect(freshWrapper.vm.foo).to.equal(false)

api/mount.html.body:
mount(component,{,options}])

Arguments:

{Component} component
{Object} options
{boolean} attachToDocument
{Object} context
{Object} slots  
{Array|Component|String} default  
{Array|Component|String} named  


{Object} globals
{Object} instance
{Object} stub 




Arguments:

Returns: {Wrapper}

Options:


options (Object): a Vue options object. Vue options are passed to the component when a new instance is created. , e.g. store, propsData. For full list, see the Vue API. Also takes vue-test-utils options:
options.attachToDocument (Boolean): Component will attach to DOM when rendered. This can be used with hasStyle to check multi element CSS selectors
options.context (Object): Passes context to functional component. Can only be used with functional components
options.localVue ('Object): vue class to use in mount. See createLocalVue
options.slots (Object): Render component with slots.
options.slots.default (Array[Component]|Component|String): Default slot object to render, can be a Vue component or array of Vue components
options.slots.name (Array[Component]|Component): Named slots. i.e. slots.name will match a , can be a Vue component or array of Vue components
options.globals (Object): Add globals to Vue instance.
options.stub ('Object): Stubs components matching the name passed with a string 

Usage:

Returns Wrapper of first DOM node or Vue component matching selector. 
Use any valid selector.
Without options:
import { mount } from 'vue-test-utils'
import { expect } from 'chai'
import Foo from './Foo.vue'

describe('Foo', () => {
  it('renders a div', () => {
    const wrapper = mount(Foo)
    expect(wrapper.contains('div')).to.equal(true)
  })
})

With Vue options:
import { mount } from 'vue-test-utils'
import { expect } from 'chai'
import Foo from './Foo.vue'

describe('Foo', () => {
  it('renders a div', () => {
    const wrapper = mount(Foo, {
      propsData: {
        color: 'red'
      }
    })
    expect(wrapper.hasProp('color', 'red')).to.equal(true)
  })
})

Attach to DOM:
import { mount } from 'vue-test-utils'
import { expect } from 'chai'
import Foo from './Foo.vue'

describe('Foo', () => {
  it('renders a div', () => {
    const wrapper = mount(Foo, {
      attachToDocument: true
    })
    expect(wrapper.contains('div')).to.equal(true)
  })
})

Default and named slots:
import { mount } from 'vue-test-utils'
import { expect } from 'chai'
import Foo from './Foo.vue'
import Bar from './Bar.vue'
import FooBar from './FooBar.vue'

describe('Foo', () => {
  it('renders a div', () => {
    const wrapper = mount(Foo, {
      slots: {
        default: [Bar, FooBar],
        fooBar: FooBar, // Will match ,
        foo: ''
      }
    })
    expect(wrapper.contains('div')).to.equal(true)
  })
})

Adding globals:
import { mount } from 'vue-test-utils'
import { expect } from 'chai'
import Foo from './Foo.vue'

describe('Foo', () => {
  it('renders a div', () => {
    const $route = { path: 'http://www.example-path.com' }
    const wrapper = mount(Foo, {
      globals: {
        $route
      }
    })
    expect(wrapper.vm.$route.path).to.equal($route.path)
  })
})

Stubbing components:
import { mount } from 'vue-test-utils'
import { expect } from 'chai'
import Foo from './Foo.vue'
import Bar from './Bar'

describe('Foo', () => {
  it('renders a div', () => {
    const wrapper = mount(Foo, {
      stub: {
        Bar: ''
      }
    })
    expect(wrapper.contains('.stubbed')).to.equal(true)
    expect(wrapper.contains(Bar)).to.equal(true)
  })
})


See also: Wrapper

