api/wrapper/trigger.html.body:
trigger(eventName)

Arguments:

{string} eventName
{Object} options 
{boolean} preventDefault




Usage:


Triggers an event on the Wrapper DOM node.
Trigger takes an optional options object. The properties in the options object are added to the Event.
You can run preventDefault on the event by passing preventDefault: true in options.
import { mount } from 'vue-test-utils'
import { expect } from 'chai'
import sinon from 'sinon'
import Foo from './Foo'

const clickHandler = sinon.stub()
const wrapper = mount(Foo, {
  propsData: { clickHandler }
})

wrapper.trigger('click')

wrapper.trigger('click', {
  button: 0
})

wrapper.trigger('click', {
  preventDefault: true
})

expect(clickHandler.called).to.equal(true)

api/wrapper-array/at.html.body:
at(index)

Arguments:

{number} index


Returns: {Wrapper}

Usage:


Returns Wrapper at index passed. Uses zero based numbering (i.e. first item is at index 0).
import { shallow } from 'vue-test-utils'
import { expect } from 'chai'
import Foo from './Foo.vue'

const wrapper = shallow(Foo)
const divArray = wrapper.findAll('div')
const secondDiv = divArray.at(1)
expect(secondDiv.is('p')).to.equal(true)

